import React from "react";
import Nav from "../nav/Nav";

const Header = (props) => {
  return (
    <header style={styles.header}>
      <h1 style={styles.h1}>{props.pgTitle}</h1>
    </header>
  );
};

export default Header;

const styles = {
  header: {
    display: "flex",
    flextDirection: "row",
    backgroundColor: "#ccc",
  },
};
